
    const movies = [
      { title: "Stranger Things", genre: "Thriller", language: "English", image: "data:image/jpeg;base64," },
      { title: "RRR", genre: "Action", language: "Telugu", image: "data:image/jpeg;base64," },
      { title: "Money Heist", genre: "Drama", language: "Spanish", image: "data:image/jpeg;base64," },
      { title: "The Witcher", genre: "Fantasy", language: "English", image: "data:image/jpeg;base64," },
      { title: "Drishyam", genre: "Thriller", language: "Hindi", image: "data:image/jpeg;base64," },
      { title: "Jigarthanda", genre: "Action", language: "Tamil", image: "data:image/jpeg;base64," }
    ];

    const kidsContent = [
      { title: "Peppa Pig", genre: "Kids", language: "English", image: "data:image/jpeg;base64," },
      { title: "Chhota Bheem", genre: "Kids", language: "Hindi", image: "data:image/jpeg;base64," }
    ];

    function displayMovies(movieList, gridId) {
      const grid = document.getElementById(gridId);
      grid.innerHTML = "";
      movieList.forEach(movie => {
        grid.innerHTML += `
          <div class="movie-card">
            <img src="${movie.image}" alt="${movie.title}">
            <div class="movie-content">
              <div class="movie-title">${movie.title}</div>
              <div class="movie-meta">${movie.genre} | ${movie.language}</div>
            </div>
          </div>
        `;
      });
    }

    function filterMovies(language = null) {
      const query = document.getElementById("searchInput").value.toLowerCase();
      const filtered = movies.filter(movie => {
        const matchQuery = movie.title.toLowerCase().includes(query) ||
          movie.genre.toLowerCase().includes(query) ||
          movie.language.toLowerCase().includes(query);
        const matchLang = language ? movie.language.toLowerCase() === language.toLowerCase() : true;
        return matchQuery && matchLang;
      });
      displayMovies(filtered, "movieGrid");
    }

    function populateLanguageFilter() {
      const languages = [...new Set(movies.map(movie => movie.language))];
      const container = document.getElementById("languageFilter");
      container.innerHTML = '<strong style="margin-right: 10px;">Filter by Language:</strong>';
      languages.forEach(lang => {
        const btn = document.createElement("button");
        btn.textContent = lang;
        btn.onclick = () => {
          document.querySelectorAll('.language-filter button').forEach(b => b.classList.remove('active'));
          btn.classList.add('active');
          filterMovies(lang);
        };
        container.appendChild(btn);
      });
    }

    function login(event) {
      event.preventDefault();
      const userId = document.getElementById("userId").value;
      if (userId.trim() !== "") {
        localStorage.setItem("userId", userId);
        document.getElementById("loginPage").style.display = "none";
        document.getElementById("welcomeUser").textContent = `Welcome, ${userId}`;
        displayMovies(movies, "movieGrid");
        displayMovies(kidsContent, "kidsGrid");
        populateLanguageFilter();
      }
    }

    function logout() {
      localStorage.removeItem("userId");
      document.getElementById("loginPage").style.display = "flex";
      document.getElementById("movieGrid").innerHTML = "";
      document.getElementById("kidsGrid").innerHTML = "";
      document.getElementById("searchInput").value = "";
      document.getElementById("welcomeUser").textContent = "";
      document.getElementById("languageFilter").innerHTML = "";
    }

    window.onload = () => {
      const savedUser = localStorage.getItem("userId");
      if (savedUser) {
        document.getElementById("loginPage").style.display = "none";
        document.getElementById("welcomeUser").textContent = `Welcome, ${savedUser}`;
        displayMovies(movies, "movieGrid");
        displayMovies(kidsContent, "kidsGrid");
        populateLanguageFilter();
      }
    }
